  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes rail surveys conducted
  on Great River and Clarence Cannon NWRs. This project was undertaken to 1) contribute
  to a nationwide assessment of the efficacy of a call broadcast technique in documenting
  presence of bitterns and rails, and 2) document presence and habitat use of bitterns
  and rails at Clarence Cannon and Delair districts of the Great River NWR, and to
  update information on these species for Ted Shanks Conservation Area, where these
  birds were studied in the late 1980's. Our focus was primarily on King Rails and
  Least Bitterns -to determine their presence and abundance and examine habitat characteristics
  associated with presence of these two species in the Bi-County area of Pike County
  in Missouri and Illinois. However, we also used tape playback to try and detect
  American Bitterns and Black Rails, as well as possibly detect Yellow and Virginia
  Rails and Soras especially early in the season when these later three species could
  have been in the area during migration.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
